import React from 'react';
import { withRouter } from 'react-router-dom';
import './menu.scss';
import { Menu } from 'antd';
const { SubMenu } = Menu;
class MenuCom extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
    };
  }
  render() {
    return (
      <div className="menu" style={{ width: 200 }}>
        <div className="menu-title">
          <div className="title-img">
            <img src="https://dss1.bdstatic.com/70cFuXSh_Q1YnxGkpoWK1HF6hhy/it/u=3238317745,514710292&fm=26&gp=0.jpg" alt=""/>
            <div>
              <p>Welcome</p>
              <p>Dr.Lara</p>
            </div>
          </div>
          <p className="general">GENERAL</p>
        </div>
        <Menu
          defaultSelectedKeys={['1']}
          // defaultOpenKeys={['sub1']}
          mode="inline"
          theme="dark"
        >
          <Menu.Item key="1">
            Home
          </Menu.Item>
          <Menu.Item key="1">
            Profile
          </Menu.Item>
          <SubMenu key="sub1" title="Appoin">
            <Menu.Item key="2">Option 5</Menu.Item>
            <Menu.Item key="3">Option 6</Menu.Item>
            <Menu.Item key="4">Option 7</Menu.Item>
            <Menu.Item key="5">Option 8</Menu.Item>
          </SubMenu>
        </Menu>
      </div>
    );
  }
}

export default withRouter(MenuCom);
